css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("startpage.com") {

body {
  background: black url(data:image/jpeg;base64,) repeat-x !important;
  color: gray !important;
}

a:link,
a:visited {
  color: silver !important;
  text-decoration: none !important;
}

a:hover,
a:active {
  color: white !important;
  text-decoration: none !important;
}

/* ------ homepage -------- */

#content #main_link {
  background: transparent url(data:image/png;base64,) 60px 0 no-repeat !important;
}

#content img[width="206"] { 
  visibility: hidden !important;
}

#caption {
  color: gray !important;
  font-size: 90% !important;
  margin-top: 0 !important;
}

#caption span {
  color: gray !important;
}

input#query {
  background: #eee url(data:image/jpeg;base64,) repeat-x !important;
  border: 1px solid silver !important;
  color: silver !important;
  box-shadow: none !important;
}

input#submit {
  border: 1px solid silver !important;
  border-left: none !important;
}

#enhanced { visibility: hidden !important; }

#links {
  color: gray !important;
  font-size: 90% !important;
}

#news_message_content {
  background: #111 !important;
  border: 1px solid #333 !important;
}

#footer { color: gray !important; }

/* ------- search results --------- */

#logo img { display: none !important; }

#logo {
  width: 154px !important;
  height: 103px !important;
  background: transparent url(data:image/png;base64,) no-repeat !important;
}

input#query_top,
input#query_bottom {
  background: #111 none !important;
  border: 1px solid silver !important;
  color: silver !important;
}

input#submit1 {
  border: 1px solid silver !important;
  border-left: none !important;
}

a#detail,
#tod_wrap,
#sponsored { display: none !important; }

span.url {
  color: #4cd13e !important;
}

#results.show_side_bar { border-left: 1px solid #555 !important; }
#by_time { border-right: none !important; }

.result h3 a { text-decoration: underline !important; }

.desc b { color: gray !important; }

#jumpsbar { color: #555 !important; }

#within { color: gray !important; }

#footer_links a { color: gray !important; }

#fade_date_promo,
.date_promo { display: none !important; }


/* --------- picture results ---------- */

[id*="imageRow"] {
  background: black none !important;
}

[id*="picThumbDescTD"] span.normaltext {
  color: gray !important;
}

td[id*="picThumbDescTD"] span.reltext {
  color: #555 !important;
}

[id*="imageRowBorder"] td {
  background: #222 none !important;
}

/* ------- video results --------- */

img[alt="Powered By BLINKX"] { display: none !important; }

#video_results span.normaltext[style="color:green;"] { color: #4cd13e !important; }

#video_results .title2 { text-decoration: underline !important; }

.video_desc b { color: gray !important; }


/* -------- advanced search ---------- */

img[alt="StartPage"] { visibility: hidden !important; }

form#search_form span { color: gray !important; }
form#search_form span font { color: silver !important; }

input.TEXT {
  background: #222 none !important;
  color: silver !important;
  border: 1px solid gray !important;
}

/* ---------- settings & language ----------- */

[class="tdmenu tdmenurepeat"] a,
[class="tdmenu tdmenurepeat"] a:link,
[class="tdmenu tdmenurepeat"] a:visited {
  color: black !important;
}

[class="tdmenu tdmenurepeat"] a:hover,
[class="tdmenu tdmenurepeat"] a:active {
  text-decoration: underline !important;
}

#lang_div {
  background: black none !important;
  color: silver !important;
  border: 1px solid gray !important;
}



}
